import React, { useEffect, useState } from 'react'
import './list.css'

import data from './data.json';
import { NavLink } from "react-router-dom";
function List() {



    return (
        <div className='list-page'>
            <div className='list'>
                <p>Select an account</p>
                <div>
                    {
                        data.map(user => {
                            return (
                                <div className='name'>
                                    <div className='name-img'><img src={user.profilepicture}></img></div>
                                    <div id='name' className='name-text'>
                                        <nav>
                                            <NavLink className="name-list" to={`/${user.id}/profile`} >
                                                {user.name}
                                            </NavLink>
                                        </nav>
                                    </div>
                                </div>
                            )
                        })
                    }
                </div>
            </div>
        </div>
    )
}

export default List
